contracts/supply_chain.sol.content:
pragma solidity ^0.8.0;


contract SupplyChainManagement {
    address public owner;

    struct Actor {
        string actorType;
        string name;
        string region;
        uint256 nationalID;
    }

    mapping(address => Actor) public actors;
    mapping(address => bool) public registeredActors;

    event Registration(address indexed user, string actorType, string name, string region, uint256 nationalID);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can execute this");
        _;
    }

    constructor() {
        owner = msg.sender;
    }
    
    function register(string memory _actorType, string memory _name, string memory _region, uint256 _nationalID) external {
        require(!registeredActors[msg.sender], "Actor already registered");

        actors[msg.sender] = Actor(_actorType, _name, _region, _nationalID);
        registeredActors[msg.sender] = true;

        emit Registration(msg.sender, _actorType, _name, _region, _nationalID);
    }

    function calculateReorderPoint(uint256 _annualDemand, uint256 _totalDays, uint256 _deliveryDays) external pure returns (uint256) {
        return (_annualDemand * _deliveryDays) / _totalDays;
    }

    function calculateEconomicOrderQuantity(uint256 _annualDemand, uint256 _orderCost, uint256 _holdingCost) external pure returns (uint256) {
        uint256 x = (2 * _annualDemand * _orderCost / _holdingCost);
        uint z = (x + 1) / 2;
        uint256 y = x;
        while (z < y) {
            y = z;
            z = (x / z + z) / 2;
        }
        return y;
    }

    function createOrder(uint256 _quantity, address _ordererID, address _supplierID, uint256 _productID) external returns (bytes32) {
        // Assuming the order creation logic and order ID generation here
        bytes32 orderID = keccak256(abi.encodePacked(_quantity, _ordererID, _supplierID, _productID));

        // Assuming order is not automatically accepted
        emit LogOrderCreated(orderID, _quantity, _ordererID, _supplierID, _productID, false);

        return orderID;
    }

    event LogOrderCreated(bytes32 orderID, uint256 quantity, address ordererID, address supplierID, uint256 productID, bool accepted);

    function acceptOrder(bytes32 _orderID, bool _accept) external {
        // Assuming the logic to handle order acceptance here
        emit LogOrderAccepted(_orderID, _accept);
    }

    event LogOrderAccepted(bytes32 orderID, bool accepted);

    function makePayment(address _sender, address _receiver, uint256 _amount) external onlyOwner {
        // Assuming the logic to handle payment here
        emit LogPaymentMade(_sender, _receiver, _amount);
    }

    event LogPaymentMade(address indexed sender, address indexed receiver, uint256 amount);
}

